func findMin(nums []int) int {
    N := len(nums)
    left, right := 0, N-1
    for left <= right {
        mid := (left + right) / 2
        if 0 < mid && mid < N-1 && nums[mid-1] > nums[mid] && nums[mid] < nums[mid+1] {
            return nums[mid]
        }
        if nums[left] <= nums[mid] && nums[mid] <= nums[right] {
            return nums[left]
        }
        if nums[left] <= nums[mid] {
            left = mid + 1
        } else {
            right = mid - 1
        }
    }
    return -1
}

